import React from 'react'
import './ModalWindow.css'

export function ModalWindow({onClose, children}) {
    return (
        <div className='modal_window'>
            <button className="modal_close" onClick={onClose}><i class="fa-solid fa-xmark"></i></button>
            {children}
        </div>
    )
}
